import { PRO_LIST } from '../actions/ActionsTypes';

export const initialState = {
    data: []
};

export default (state = initialState, action: any) => {
    switch (action.type) {
        case PRO_LIST:
            return Object.assign({}, state, { data: action.data });
        default:
            return state;
    }
};
